def check_string(input_string):
    """
    Checks if a string is generated by a given grammar.
    """
    try:
        # Basic check for a valid grammar
        if not isinstance(input_string, str):
            return "No"

        # Basic check for a valid grammar
        if not input_string:
            return "No"

        # Simple check.  A more robust grammar check is needed.
        for s in input_string.split():
            if not s:
                return "No"
            try:
                # Simple check for grammar generation
                for entry in input_string.split():
                    if entry.startswith('S'):
                        continue
                    elif entry.startswith('NT'):
                        if len(entry) > 1:
                            break
                        else:
                            return "No"
                    elif entry.startswith('NT'):
                        if len(entry) > 1:
                            break
                        else:
                            return "No"
                return "No" # Grammar not fully parsed
            except:
                return "No"
        return "Yes"  # Grammar generated
    except Exception as e:
        return "No"

